-- ----------------------------
-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `sys_user_id` varchar(32) NOT NULL COMMENT '用户id',
  `user_name` varchar(64) NOT NULL COMMENT '用户名',
  `work_code` varchar(64) DEFAULT '' COMMENT '工号',
  `certificate_num` varchar(64) DEFAULT '' COMMENT '身份证号',
  `phone` varchar(16) NOT NULL DEFAULT '' COMMENT '手机号',
  `email` varchar(64) DEFAULT '' COMMENT '邮箱',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '用户是否启用: 0->否 1->是',
  `gender` tinyint(1) DEFAULT '0' COMMENT '性别',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '用户类型: 1-> 个人用户 2 ->机构用户 3-> 系统用户',
  `is_auth` tinyint(1) DEFAULT '0' COMMENT '是否已实名认证: 0->否 1->是',
  `data_source` tinyint(1) NOT NULL DEFAULT '1' COMMENT '数据来源: 1-> 系统默认 2->第三方系统',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `creator_id` varchar(32) DEFAULT '' COMMENT '创建人',
  `creator_name` varchar(64) DEFAULT '' COMMENT '创建人名称',
  `creator_depart_id` varchar(32) DEFAULT '' COMMENT '创建人部门id',
  `creator_depart_name` varchar(256) DEFAULT '' COMMENT '创建人部门名称',
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `updater_id` varchar(32) DEFAULT '' COMMENT '更新人',
  `updater_name` varchar(64) DEFAULT '' COMMENT '更新人名称',
  `updater_depart_id` varchar(32) DEFAULT '' COMMENT '更新人部门id',
  `updater_depart_name` varchar(256) DEFAULT '' COMMENT '更新人部门名称',
  `real_name` varchar(64) DEFAULT '' COMMENT '用户真实姓名',
  `sys_tenant_id` varchar(32) DEFAULT '' COMMENT '系统租户id',
  `remark` varchar(256) DEFAULT '' COMMENT '人员描述信息',
  `application_id` varchar(32) DEFAULT '' COMMENT '所属系统',
  `profession` int(1) DEFAULT '0' COMMENT '个人职业',
  `industry` int(1) DEFAULT '0' COMMENT '所在行业',
  PRIMARY KEY (`sys_user_id`) USING BTREE,
  UNIQUE KEY `index_user_id` (`sys_user_id`) USING BTREE COMMENT '主键唯一索引'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

